import React from "react";

const Contact = () => {
  return (
    <div className="contact">
      <h4> Sree Chakram</h4>
      <h4> MERN Stack Developer</h4>
      <h4> chakramsree@gmail.com</h4>
    </div>
  );
};
export default Contact;
